function NOBN_com_Pset_FDVBaneDataSportypeFra() if RcAlignment and RcType == "JBTKO_SPO Spor" then --Linjeobjekt av type jernbanespor: --(Use getPropertyValue() to avoid an endless loop, since also tracks will be assigned this formula) return getPropertyValue("FDV_BaneData.Sportype_fra_")
elseif Alignment and Alignment.RcType == "JBTKO_SPO Spor" then --Punktobjekt i jernbanespor: return Alignment.FDV_BaneData.Sportype_fra_
else --Ingen direkte angivelse av sportilhørighet: if RcAlignment then --Linjetype av annen type enn jernbanespor: x = RcAlignment.StartPoint.X y = RcAlignment.StartPoint.Y else --Punktobjekt i annen linjetype enn jernbanespor: x = geoCoord.X y = geoCoord.Y end t = getClosestTracks(x,y) n = getCollectionLength(t) --Exploit the fact that closest tracks are sorted by proximity: for i = 0,n-1 do ai = getAlignmentInfo(t[i].id,x,y) if ai.NormalProjectionExists then return t[i].FDV_BaneData.Sportype_fra_ end end --Fant ingen spor vi kunne projisere oss inn på: if RcAlignment then return _warning, "Ukjent", _info("Linjens startpunkt har ikke en projeksjon på noen av sporene i modellen, kan ikke utlede tilhørende spors anvendelsestype.") else return _warning, "Ukjent", _info("Punktobjektet har ikke en projeksjon på noen av sporene i modellen, kan ikke utlede tilhørende spors anvendelsestype.") end end end

function NOBN_com_Pset_FDVBaneDataSporNrFra() if RcAlignment and RcType == "JBTKO_SPO Spor" then --Linjeobjekt av type jernbanespor: return RC__identify(this)
elseif Alignment and Alignment.RcType == "JBTKO_SPO Spor" then --Punktobjekt i jernbanespor: return RC__identify(Alignment)
else --Ingen direkte angivelse av sportilhørighet: if RcAlignment then --Linjetype av annen type enn jernbanespor: x = RcAlignment.StartPoint.X y = RcAlignment.StartPoint.Y else --Punktobjekt i annen linjetype enn jernbanespor: x = geoCoord.X y = geoCoord.Y end t = getClosestTracks(x,y) n = getCollectionLength(t) --Exploit the fact that closest tracks are sorted by proximity: for i = 0,n-1 do ai = getAlignmentInfo(t[i].id,x,y) if ai.NormalProjectionExists then return RC__identify(t[i]) end end --Fant ingen spor vi kunne projisere oss inn på: if RcAlignment then return _warning, "Linjens startpunkt har ikke en projeksjon på noen av sporene i modellen, kan ikke utlede sportilhørighet." else return _warning, "Punktobjektet har ikke en projeksjon på noen av sporene i modellen, kan ikke utlede sportilhørighet." end end end

function NOBN_com_Pset_FDVBaneDataAvstSpormidtFra() if RcAlignment and RcType == "JBTKO_SPO Spor" then --Linjeobjekt av type jernbanespor: return string.format("%.03f",0.000), _info("Null avstand til seg selv, spor "..RC__identify(this))
elseif Alignment and Alignment.RcType == "JBTKO_SPO Spor" then --Punktobjekt i jernbanespor: return string.format("%.03f",RC__round(DistanceToAlignment)), _info("Avstand til spor "..RC__identify(Alignment))
else --Ingen direkte angivelse av sportilhørighet: if RcAlignment then --Linjetype av annen type enn jernbanespor: x = RcAlignment.StartPoint.X y = RcAlignment.StartPoint.Y else --Punktobjekt tilhørende en annen linjetype enn jernbanespor: x = geoCoord.X y = geoCoord.Y end t = getClosestTracks(x,y) n = getCollectionLength(t) --Exploit the fact that closest tracks are sorted by proximity: for i = 0,n-1 do ai = getAlignmentInfo(t[i].id,x,y) if ai.NormalProjectionExists then return string.format("%.03f",RC__round(ai.DistanceToAlignment)), _info("Avstand til spor "..RC__identify(t[i])) end end --Fant ingen spor vi kunne projisere oss inn på: if RcAlignment then return _warning, 0, _info("Linjens startpunkt har ikke en projeksjon på noen av sporene i modellen, kan ikke utlede avstand sideveis til noe spor.") else return _warning, 0, _info("Punktobjektet har ikke en projeksjon på noen av sporene i modellen, kan ikke utlede avstand sideveis til noe spor.") end end end

